import Footer from "./Layout/Footer";
import Navbar from "./Layout/Navbar";
import {BrowserRouter,Routes,Route} from ''




function App() {
  return (
   <>
   <Layout>
    <BrowserRouter>
    <Routes>
      <Route  path='/navbar' element={<Footer/>}/>
       <Route  path='/navbar' element={<Navbar/>}/>
    </Routes>
    </BrowserRouter>
   </Layout>
   </>
  );
}

export default App;
